    true,nt"url": null,nt"notes": "This provides announcements via RSS of new
    releases and updates from USDA Economic Research Service.rnrnRSS (Really Simple
    Syndication) is an easy way for you to be alerted when content that interests you
    appears on your favorite web sites. Instead of visiting a particular web site to
    browse for new articles and features or waiting for the publisher to alert you of
    new releases, RSS automatically tells you when something new is posted online (called
    a "feed").rnrnERS offers RSS feeds with headlines, descriptions, and links back
    to ERS for the full story. Feeds cover data products, publications, outlook reports,
